! Description:
!> @file
!!   Returns a profile structure containing one of the 6 US76 Standard Atmospheres
!
!> @brief
!!   Returns a profile structure containing one of the 6 US76 Standard Atmospheres
!!
!! @details
!!   There are six profiles:
!!   1 TROPICAL
!!   2 MIDLATITUDE SUMMER
!!   3 MIDLATITUDE WINTER
!!   4 SUBARCTIC SUMMER
!!   5 SUBARCTIC WINTER
!!   6 U.S. STANDARD,  1976
!!
!!   The iprof argument (1-6) selects the profile. The top-most nlevels are
!!   returned: this can be between 2 and 50 levels.
!!
!!   Profile data have been extracted from LBLRTM v12.1 lblatm.f90 file.
!!   These are strictly the same profiles as described in
!!   Anderson, G.P., J.H. Chetwynd. S.A. Clough. E.P. Shettle. F.X. Kneizys,
!!   1986: AFGL Atmospheric Constituent Profiles (0-120km). Air Force Geophysics
!!   Laboratory report AFGL-TR-86-0110.
!!
!!   All profiles are located over Atlantic Ocean.
!!   The original latitude and month are kept.
!!
!! @param[out]    err       status on exit
!! @param[in]     iprof     profile to return, 1-6
!! @param[in]     nlevels   return the top-most nlevels, 2-50
!! @param[in,out] profile   RTTOV profile structure
!
! Copyright:
!    This software was developed within the context of
!    the EUMETSAT Satellite Application Facility on
!    Numerical Weather Prediction (NWP SAF), under the
!    Cooperation Agreement dated 7 December 2016, between
!    EUMETSAT and the Met Office, UK, by one or more partners
!    within the NWP SAF. The partners in the NWP SAF are
!    the Met Office, ECMWF, DWD and MeteoFrance.
!
!    Copyright 2015, EUMETSAT, All Rights Reserved.
!
