  PROFILE % N2O = AMOL64(NLEVELS:1:-1)
  PROFILE % CO  = AMOL65(NLEVELS:1:-1)
  PROFILE % CH4 = AMOL66(NLEVELS:1:-1)
  PROFILE % SO2 = SO2(NLEVELS:1:-1)

  ELSE
    ERR = 1
    THROWM(ERR.NE.0,"invalid US76 Profile number")
  ENDIF

  PROFILE%S2M%P = PROFILE%P(NLEVELS)
  PROFILE%S2M%T = PROFILE%T(NLEVELS)
  PROFILE%S2M%Q = PROFILE%Q(NLEVELS)
  PROFILE%S2M%O = PROFILE%O3(NLEVELS)
  PROFILE%S2M%WFETC = 100000.0_JPRB
  PROFILE%S2M%U     = 5.0_JPRB
  PROFILE%S2M%V     = 2.0_JPRB
  
  PROFILE%SKIN%SURFTYPE  = 1_JPIM
  PROFILE%SKIN%WATERTYPE = 1_JPIM
  PROFILE%SKIN%T         = PROFILE%T(NLEVELS)
  PROFILE%SKIN%SALINITY  = 35.0_JPRB

CATCH
END SUBROUTINE
